import React from 'react';
import { Container } from 'shards-react'

const Notification = () => {
    return (
        <Container fluid className="main-content-container px-4">
            <h3>Messages</h3>
            <div style={{ height: '50px', background: 'white', display: 'flex', justifyContent: 'space-between', alignItems: 'left' }}>
                <h4>All</h4>
                <h4>Read</h4>
                <h4>Unread</h4>
                <h4>Starred</h4>
            </div>
        </Container>
    )
}

export default Notification
